import React from 'react';

function SynthesiaVideoPlayer() {
  const videoId = '3a031530-0151-4855-80d0-f006d956bf60';
  return (
    <div style={{ position: 'relative', overflow: 'hidden', paddingTop: '56.25%' }}>
      <iframe
        src={`https://share.synthesia.io/embeds/videos/${videoId}`}
        loading="lazy"
        title="Synthesia video player - Your AI video"
        allow="encrypted-media; fullscreen;"
        style={{
          position: 'absolute',
          width: '100%',
          height: '100%',
          top: 0,
          left: 0,
          border: 'none',
          padding: 0,
          margin: 0,
          overflow: 'hidden'
        }}
        autoplay 
        muted
        
      />
    </div>
  );
}

export default SynthesiaVideoPlayer;
